9.body:
To customize a plugin, you modify the parameters of it. For each plugin, the parameters are encoded in a CBOR object. You don't have to know what CBOR exactly is, because the editor will automatically convert CBOR to JSON and vice versa. Sometimes you will see such object in the editor: { "__byte_repr": "utf8", "data": "my_trojan_password"
} Don't be scared. Most of the time, you can treat them as strings with content of the data field. You see this because the editor encountered a binary buffer field, which may possibly contain non-UTF-8 data. In this case, the actual data is displayed in Base64 format. { "__byte_repr": "base64", "data": "3q2+7w=="
} A plugin can have many access points. Plugins chain to each other by specifying names and access points of other plugins in its parameters.

